import { AppBar, Box, Toolbar, Typography, IconButton, MenuIcon } from '@material-ui/core';
const Header = () => {
    return(
        <Box sx={{ flexGrow: 1 }}>
        <AppBar position="static">
            <Toolbar>
            <IconButton
                size="large"
                edge="start"
                color="inherit"
                aria-label="menu"
                sx={{ mr: 2 }}
            >
            <MenuIcon />
            </IconButton>
            <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                News
            </Typography>
            </Toolbar>
        </AppBar>
        </Box>
    );
}

export default Header;
